import React from "react";
// material-ui components
import withStyles from "@material-ui/core/styles/withStyles";
// core components
import Card from "./material-kit-react-master/src/components/Card/Card.jsx";
import CardBody from "./material-kit-react-master/src/components/Card/CardBody.jsx";

import imagesStyles from "./material-kit-react-master/src/assets/jss/material-kit-react/imagesStyles.jsx";

import { cardTitle } from "./material-kit-react-master/src/assets/jss/material-kit-react.jsx";

const style = {
  ...imagesStyles,
  cardTitle,
  textMuted: {
    color: "#6c757d"
  },
};

class Cards extends React.Component {
  render() {
    const { classes } = this.props;
    return(
      <div>
        <Card>
          <img className={classes.imgCardTop} src="..." alt="Card-img-cap" />
          <CardBody>
            <h4 className={classes.cardTitle}>Card title</h4>
            <p>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
            <p><small className={classes.textMuted}>Last updated 3 mins ago</small></p>
          </CardBody>
        </Card>
        <Card>
          <CardBody>
            <h4 className={classes.cardTitle}>Card title</h4>
            <p>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
            <p><small className={classes.textMuted}>Last updated 3 mins ago</small></p>
          </CardBody>
          <img className={classes.imgCardBottom} src="..." alt="Card-img-cap" />
        </Card>
      </div>
    );
  }
};

export default withStyles(style)(Cards);
